import React, { useState } from 'react'
import "./styles.scss"
import PortfolioList from './PortfolioList';

export default function Portfolio() {
    const [selected, setSelected] = useState("featured");
    const list = [
        {
            id: "featured",
            title: "Featured",

        },
        {
            id: "web",
            title: "Web Apps",
        },
        {
            id: "mobile",
            title: "Mobile",
        },
        {
            id: "design",
            title: "Design",
        },
    ];

    return (
        <div className='portfolio' id='portfolio'>
            <h1>Portfolio</h1>
            <div className="wrapperCategory">
                <ul>
                    {list.map((item) => (
                        <PortfolioList active={selected === item.id} title={item.title} />
                    ))}
                </ul>
            </div>
            <div className="wrapperItems">
                <div className="item">
                    <img src="data:image/png;base64," alt="asd" />
                </div>
            </div>
        </div >
    )
}
